INSERT INTO `posts` (`id`, `title`, `star`, `labelCode`, `address`, `attributesId`, `categoryCode`, `description`, `userId`, `overviewId`, `imagesId`, `createdAt`, `updatedAt`) VALUES
('007008de-bba7-4c01-8e81-812c3a58de42', 'Cho thuê phòng cao cấp, đầy đủ tiện nghi, như căn hộ, ngay trung tâm Quận 10', '5', 'IGL4', 'Địa chỉ: 128 Đường Thành Thái, Phường 14, Quận 10, Hồ Chí Minh', 'd8241527-c87e-4690-97ec-93b7ae8ddc99', 'CTPT', '[\"Cho thuê phòng đẹp trung tâm Quận 10 tiện nghi:\",\"- Địa chỉ 1: 7A/19/19 Thành Thái, P.14, Q.10.\",\"- Địa chỉ 2: 128 Thành Thái, P.12, Q. 10\",\"Cho thuê phòng trọ nằm cạnh siêu thị Sài Gòn, ngân hàng, gần ngay ngã tư 3/2- Thành Thái - Nguyễn Tri Phương. Gần đại học Kinh Tế TP HCM, Bách Khoa TP HCM, Y Dược. Giao thông thuận tiện, gần chợ trạm xe bus.\",\"Mặt tiền nhà đẹp, hẻm trước nhà 8m xe hơi quay đầu được\",\"Vị trí trung tâm thành phố giáp ngay Quận 1, Quận 3, Tân Bình, Phú Nhuận. Cho bạn thuận tiện trong công việc.\",\"Nhà có thang máy, chỗ để xe rộng rãi.\",\"Phòng rộng từ 22m2 - 35m2, được trang bị đủ tiện nghi như: (Máy lạnh, tivi, giường nệm, tủ lạnh... ) thiết bị cao cấp mới mua đem lại sự tiện nghi và thoải mái trong căn phòng của bạn, ban chỉ việc xách quần áo đến và ở.\",\"Giá thuê chỉ từ 4.5 triệu - 7 triệu/tháng. \",\"Chúng tôi cam kết tuyệt đối với bạn rằng! Hình chụp như thế nào thì phòng của bạn như thế đó. Thậm chí có thể đẹp hơn trong thực tế nếu bạn tới xem trực tiếp.\",\"Liên hệ: A. Khang 0938297275 hoặc 0938. 111. 005\"]', '359ae7e2-843d-40f9-affc-5c22be329df0', 'fc67164e-99b1-4116-8c6e-d5f36f7ec453', 'e376165e-8966-4b83-89ba-fd9b2656edae', '2025-03-27 13:50:33', '2025-03-27 13:50:33'),
('03a2094b-ebae-4b37-bc0f-bf6da34979a5', 'Căn hộ mini khu Nguyễn Gia Trần Não trung tâm Quận 2. DT từ : 21m2 - 36m2, giá từ 4.1tr -7.6tr', '3', 'DET1', 'Địa chỉ: 21 Đường số 10, Phường Bình An, Quận 2, Hồ Chí Minh', '9e928d93-f862-4138-aa6b-d3cb22f86c4b', 'CTCH', '[\"CHO THUÊ CĂN HỘ MINI DIỆN TÍCH TỪ TỪ : 21M2 - 40M2, MỚI GIÁ TỐT TẠI TRUNG TÂM QUẬN 2- ĐƯỜNG 10 TRẦN NÃO, F BÌNH AN. Q 2; Tp . HCM\",\"GIÁ THUÊ THỪ:  4.1 Triệu/Tháng đến 7.6 Triệu/Tháng\",\"Nhà ở yên tĩnh, mới , đẹp, an ninh, kết nối thuận tiện các quận vùng lân cận như Q1, Q BÌNH THẠNH, Q3,Q1, THỦ ĐỨC , Q9…\",\"Tiện ích: Cho quý khách chọn căn hộ mini phường Bình An, Quận 2, HCM.\",\"Chọn nhà ở ngay gần đường Trần Não Trung Tâm Quận 2; Tp. HCM là quý khách sở hữu nhiều tiện ích như:\",\"- Gần công viên thuận tiện cho việc rèn luyện sức khỏe và thư giãn hàng ngày\",\"- Gần chợ, siêu thị, TT thương mai, chợ, quán cà phê , nhà hàng…\",\"- Gần bệnh viện , TT y tế, phòng khám…\",\"- Gần trường học, công, tư thục, quốc tế, trường năng kiếu ; trường Đại Học …\",\"- Gần các trung tâm ngoại ngữ; Ngân Hàng; Phòng Công chứng …\",\"Nhà thuê ở đường 10 phường Bình An mới 100%, khu nhà ở thoáng mát hành lang rộng chuẩn với 1 thang máy, 1 thang bộ, hệ thống PCCC, camera an ninh,kiểm soát kĩ cửa ra vào mỗi phòng,có bảo vệ giữ xe,có máy giặt ,phòng rộng có cửa sổ thông, thoáng mát,có chỗ phơi đồ riêng mỗi phòng, có bếp, có bồn rửa chén, phòng tắm rộng đầy đủ tiện nghi, wifi miễn phí.\",\"Quý khách sẽ hài lòng khi chọn thuê nhà an cư tại trung tâm Quận 2 Tp. HCM.\",\"Liên hệ xem nhà hoặc cần thêm thông tin vui lòng gọi số: 093 116 22 55\"]', '0820d987-1ad0-47d0-b2a4-a4cdc3201f66', '590dd7ab-626a-457a-b22f-39bf1312a11b', '511efba4-f6ac-4b5e-99a0-70d6758448fc', '2025-03-27 13:45:30', '2025-03-27 13:45:30'),
