('b5df0826-8f4c-4e5d-9133-bc965c381763', 'Căn Hộ Đầy Đủ Nội Thất Cao Cấp - Thoáng Mát - Ngay Công Viên Phần Mềm Quang Trung', '0', 'JLT9', 'Địa chỉ: Đường Tô Ký, Phường Trung Mỹ Tây, Quận 12, Hồ Chí Minh', '9a93ed97-51a2-4288-99ca-6569e0409305', 'CTCH', '[\"CHO THUÊ CĂN HỘ DỊCH VỤ FULL NỘI THẤT CAO CẤP TẠI QUẬN 12\",\"Trung Mỹ Tây 14A, phường Trung Mỹ Tây, quận 12\",\"5.000.000 - 5.500.000 (studio full nội thất)\",\"Nội thất bao gồm: tủ lạnh, bàn ghế, giường nệm, tivi, kệ bếp tủ bếp, tủ quần áo, máy giặt riêng, máy lạnh, bếp từ đơn/đôi (tùy phòng)\",\"Vị trí:\",\"- Gần bến xe An Sương, siêu thị, khu ăn uống, gần chợ\",\"- Hẻm thông các đường lớn, có nhiều toà nhà sát bên\",\"- Khu nhân viên văn phòng, sinh viên rất yên tĩnh, thoải mái.\",\"Căn hộ rộng, đẹp, mới, sang trọng, thông thoáng, đầy đủ tiện nghi, có các phòng ngủ bên trọng cực thoải mái.\",\"Có thang máy, wifi riêng từng phòng, nước nóng lạnh\",\"Hầm xe có bảo vệ trông coi 24/7\",\"Giờ giấc tự do, chìa khóa riêng và có thẻ từ, không chung chủ.\",\"Chi phí khác:\",\"Điện: 4000đ/kwh\",\"Nước: 100k/người\",\"Xe: 100k/xe\",\"Phí dịch vụ: 170k/phòng\",\"Liên hệ Trang: 0707.142.793 (call/zalo) để được tư vấn và hỗ trợ xem phòng trực tiếp\"]', 'fc583072-46c8-4b69-ad26-595865ed1ab2', '34050caa-96ba-48fd-bee5-897a4da417f7', '093f0b4b-dcc5-49f2-824b-c639d1415583', '2025-03-27 13:45:30', '2025-03-27 13:45:30');
