('be0a7dda-2ac0-4cfd-8787-c6f16332fb91', 'Căn Hộ Full Nội Thất Gần ĐH TDTU - RMIT - UFM', '0', 'JSD5', 'Địa chỉ: Đường Nguyễn Thị Thập, Phường Tân Hưng, Quận 7, Hồ Chí Minh', '1e52bd92-84e2-4cf0-b8f8-994277fc04b3', 'CTCH', '[\"CHDV Studio ̣̂ ̂́\",\"Vị trí: Ngay Lotte Mart Q7\",\"Gần đại học TDT, Tài chính - Marketing, Big C, Vincom Trần Trọng Cung, chợ, cửa hàng tiện lợi,...\",\"Căn hộ full nội thất, cửa sổ, ban công thoáng\",\"Giờ giấc tự do, không chung chủ\",\"Thang máy rộng\",\"Internet tốc độ cao\",\"Camera an ninh\",\"Giá công khai các dạng:\",\"Dạng phòng Studio Full NT: 4tr - 8tr\",\"Dạng phòng Duplex Full NT: 5tr5 - 7tr5\",\"Dạng phòng 1PN Full NT: 6tr2 - 8tr\",\"---------------------------------------\",\"Căn hộ dịch vụ, chung cư, phòng trọ cho thuê\",\"Call, Imess, Zalo...\"]', '739652a4-7e0c-47f6-acd5-613e9c1d4639', 'edd31187-3f50-47ec-9699-6c4dd77dc999', '8ee2fd51-3efb-4364-8124-2dc9e93e1fe3', '2025-03-27 13:45:30', '2025-03-27 13:45:30'),
('c2c8a03c-0b7c-4067-8361-0574b3e5a47a', 'PHÒNG CHO THUÊ NGAY LOTTE Q.7 - CHỈ TỪ 3TR - BAO GIÁ TỐT - Alo 0988.373.731', '4', 'CXO5', 'Địa chỉ: 80 Đường số 3, Phường Tân Kiểng, Quận 7, Hồ Chí Minh', '1196e51b-36b3-46ba-b9af-5fe4f64f548c', 'CTPT', '[\"Các tiện ích chỉ có ở tại Fullhouse ngay Lotte Q.7. 100% cư dân đều đã chích vacxin 2 mũi và dân trí cao, tuân thủ 5K và pháp luật.\",\"Ngay Lotte Q.7 (đi bộ 2 phút đến đại siêu thị)! Alo ngay: 0988.373.731 Ms Hòa.\",\"Ngay dưới tòa nhà là \\\"Thiên đường Ốc\\\" đủ các món ăn ngon\",\"Căn phòng dành cho bạn thì đầy đủ tiện nghi, tiết kiệm điện và bảo vệ môi trường với hệ đèn LED - Nước nóng năng lượng mặt trời - Máy lạnh Inverter - WC và bếp riêng tiện nghi và tự do.\",\"Tòa nhà luôn được vệ sinh sạch sẽ để bảo vệ sức khỏa toàn bộ dân cư.Tòa nhà xài hệ thống NLMT và máy lạnh Inverter giúp tiết kiệm điện.\",\"Tòa nhà 8 tầng mới xây sạch,đẹp,văn minh thoáng mát, an ninh. Liền kề 5 phút đến Q1, Q4, Q5, Q8, Crescent Mall, SC Vivo, vị trí vàng đẹp Q. 7...Thuê chỗ ở bây giờ cần phải đảm bảo an toàn PCCC tuyệt đối. Tòa nhà căn hộ cho thuê cao cấp của chúng tôi có thẩm duyệt PCCC và đã nghiệm thu PCCC kèm theo bảo hiểm đảm bảo an toàn cho toàn bộ cư dân sống và làm việc tại đây, có an cư, an toàn mới lạc nghiệp.\",\"Giá từ 3.0 - 4.5 triệu/tháng, bao giá tốt khắp khu vực.\",\"Alo ngay: 0988.373.731 Ms Hòa.\",\"Đảm bảo 100% sự hài lòng.\",\"80 Đường Số 03, P. Tân Kiểng, Q. 7 - LH: 0988.373.731 Ms Hòa.\"]', '37dd9688-22d9-4dd8-be41-403614e4f5f3', '56710e24-8228-489b-b797-58f68d83b61e', 'ef707b83-af69-4ba9-9c47-de10be1ad5bd', '2025-03-27 13:50:33', '2025-03-27 13:50:33'),
('c32de4a9-4b82-44e5-bb96-3eaa616f6c17', 'PHÒNG KTX ĐẠI HỌC CÔNG NGHIỆP (200M) THANG MÁY, MÁY LẠNH, MÁY GIẶT, WIFI, BẾP', '5', 'CHO5', 'Địa chỉ: 60/18A Đường Huỳnh Khương An, Phường 5, Quận Gò Vấp, Hồ Chí Minh', '00083db1-bc2c-4915-832d-775dc7df8378', 'CTPT', '[\"Be Home ký túc xá đáng sống.\",\"Ngay cổng 4 đại học Công Nghiệp TP. HCM - 200m. Đi bộ 3P.\",\"Giờ giấc tự do.\",\"Ưu đãi giá 900k/tháng đầu tiên cho 20 bạn đăng kí sớm nhất.\",\"Địa chỉ: 60/18A Huỳnh Khương An, Phường 5, Quận Gò Vấp, TP. HCM.\",\"Không gian rộng, có cửa sổ.\",\"Trang bị giường, nệm và drap mới.\",\"Máy lạnh.\",\"Nhà vệ sinh riêng.\",\"Có bếp nấu ăn riêng trong phòng.\",\"Hệ thống wifi công nghiệp mạnh mẽ, ổn định.\",\"Trang bị máy giặt và nơi phơi đồ.\",\"Không gian đảm bảo luôn được vệ sinh sạch sẽ.\",\"Thang máy tiện lên xuống, camera an ninh, bảo vệ 24/7.\",\"Khu tập thể dục thể thao rộng rãi.\",\"Đảm bảo điều kiện sống cho bạn một cách tốt nhất.\",\"Phòng 6 giường.\",\"Giá: 1tr3/người phòng thường.\",\"1tr5/người phòng máy lạnh.\",\"Liên hệ: 0896.119.779 (Zalo + SDT)\"]', '422c0acb-d9ec-44ca-a5bd-8c17fbb2e2ca', 'e87e1df7-d397-46f2-86cf-30fa588ac4c0', '2970fb14-b504-47c4-aa88-119e3e9c202a', '2025-03-27 13:50:33', '2025-03-27 13:50:33'),
('c471b3ca-9334-4eaa-bf92-32fef2c34fcc', '1 Trệt 1 lầu có máy lạnh (dãy nhà liền kề mini) sau lưng KS HOÀ PHÁT Phạm Văn Đồng', '0', 'XIV3', 'Địa chỉ: 1098/27A Đường Phạm Văn Đồng, Phường Linh Đông, Quận Thủ Đức, Hồ Chí Minh', '3cf08e53-3e08-42fd-8c1d-d56beed64f14', 'NCT', '[\"1 Trệt 1 lầu ban công (dãy nhà liền kề mini) sau lưng KS HOÀ PHÁT Phạm Văn Đồng Thủ Đức\",\"Ở 4 người thoải mái luôn\",\"Giá: 4,2 triệu/tháng (có máy lạnh)\",\"⭐ Bếp, WC riêng tiện lợi\",\"⭐ Có cửa sổ thoáng\",\"⭐ Có camera an ninh\",\"⭐ Có bảo trì nhanh chóng\",\"⭐ Giờ giấc tự do\",\"⭐️ Yên tĩnh, mát mẻ\",\"Ko ngăn phòng riêng\",\"Có nhà xe riêng\",\"Xe ô tô tận cửa nhà thuận tiện đi lại, gần bờ sông 5p: siêu thị chợ, phòng tập Gym,…\",\"Khoá Vân tay kết hợp khoá từ 2 lớp cùng hệ thống chuông báo động giữ an ninh an toàn cho cư dân.\",\"⭐ ĐC: 1098/27A Phạm Văn Đồng, P. Linh Đông,Thủ Đức (sau lưng KS HOÀ PHÁT Phạm Văn Đồng)\",\"Hẻm 526 Phạm Văn Đồng\",\"Vui lòng gọi: 0936783819\",\"Giá dịch vụ:\",\"1/ Điện: 3.500/kw\",\"2/ Nước: 15.000/m3\",\"3/ Rác: 50.000/phòng\",\"4/ Xe: 50.000/xe\",\"- HĐ: 12 tháng\",\"- Cọc: 1 tháng\",\"- Tiền nhà 1 tháng\",\"- Thu tiền: 1 Tây (trễ hạn ko quá 5 ngày\",\" \"]', '8c19dffe-b9e7-46e6-92e0-12ca5ef984f8', 'a09a3a8b-047c-4797-adf1-9779ae2662b3', '2e1c506e-42fb-4591-801f-a9c2330bdebc', '2025-03-27 13:48:20', '2025-03-27 13:48:20'),
