('f5fbeb8c-6d31-42d7-acd9-75c62f3d511d', 'Cho thuê nhà trọ mặt tiền 8m, giá rẻ, sạch, đẹp, tự do..chỉ còn 1 căn duy nhất', '2', 'ZGT3', 'Địa chỉ: P02- 1874/11/6 Đường Lê Văn Lương, Xã Nhơn Đức, Huyện Nhà Bè, Hồ Chí Minh', '40347da7-a2df-4ac3-82b1-406bd69d1a97', 'CTPT', '[\"Nhà trọ 2 mặt tiền đường 8m, 27m2 .\",\"Đúc lửng, WC rộng, bếp riêng biệt trong phòng, trần la phông thạch cao, ốp, lát gạch men, sạch sẽ, rộng rãi thoáng mát, Phòng riêng mới, sinh hoạt độc lập, tự do, xe ô tô vào tận cửa. \",\"Gần khu công nghiệp Hiệp Phước, Long Hậu, gần chợ Nhơn Đức.Cách Nguyễn Văn Linh 6km, qua cầu Rạch Tôm 200m. Phòng đang trống vào ở ngay, HĐ 1 năm, cọc 1 tháng, trả trước tiền thuê, điện 2,500/kw, nước 17k/m3. ưu tiên nhân viên văn phòng, sinh viên\",\"Địa chỉ: 1874/11/6 Lê Văn Lương, xã Nhơn Đức, Nhà Bè ( Phòng 04)\"]', 'bb843cd8-0224-4c16-b9da-34e1d935babc', '2d29b3d3-68b5-4ee8-962f-5b2e04266c32', '79c34e07-a96d-4929-ad4d-6c48ca8cb6d7', '2025-03-27 13:50:33', '2025-03-27 13:50:33'),
('f690a93b-6b3d-48f1-8934-e51c0bfb9c52', 'Cần cho thuê nhà nguyên căn, mặt tiền đường Nguyễn Trãi, Hiệp Phú, Quận 9', '0', 'WZX9', 'Địa chỉ: Phường Hiệp Phú, Quận 9, Hồ Chí Minh', 'b8bc82dd-3121-48ed-bc9c-18a757077a8e', 'NCT', '[\"Chính chủ cho thuê nhà nguyên căn, giá tốt tại:\",\"-Địa chỉ: Mặt tiền đường Nguyễn Trãi, P. Hiệp Phú, Q. 9, TP. HCM\",\"-Diện tích: 247 m2 (13m x19m ). Tổng diện tích sàn: 450 m2. Xây 3 tầng, có sân vườn rộng mát, sân thượng phơi đồ hoặc hóng gió view đẹp.\",\"-Nhà có:\",\"+Tầng trệt nhà xe phòng khách và bếp\",\"+Tầng 1: 2 phòng ngủ, phòng sinh hoạt\",\"+Tầng 2: 2 phòng ngủ và sân thượng\",\"+4 toilet\",\"Tiện ích:\",\"-Khu dân cư đông đúc, an ninh tốt, dân trí cao, gần trường tiểu học Đinh Tiên Hoàng, trường THCS Hoa Lư, ngay cạnh chợ Kiến Thiết, gần Coopmart Xa Lộ Hà Nội, Vincom Quận 9,… Giao thông thuận tiện\",\"-Thích hợp để làm văn phòng, trung tâm ngoại ngữ, ngân hàng,..\",\"-Rất thích hợp cho người nước ngoài thuê\",\"Giá cho thuê: 40 triệu/ tháng ( TL)\",\"Liên hệ: 0902973753 gặp a Thủ\"]', 'cc204ef2-0113-40b4-858c-ca058cd5acbf', '1e5fbf54-f33b-43a5-b57b-81b543029de9', 'f19872d5-579c-4986-87ab-b2e59614d6e1', '2025-03-27 13:48:20', '2025-03-27 13:48:20'),
('f6c02a1f-3630-4022-a5a4-1eefafa5a7d0', 'Cho thuê phòng trọ đầy đủ nội thất, đường 3/2, khu Kỳ Hòa, Quận 10', '3', 'FDQ9', 'Địa chỉ: 181/36 Đường số 3/2, Phường 11, Quận 10, Hồ Chí Minh', '0e49d042-c70f-4886-b08b-5e889083b111', 'CTPT', '[\"Chính chủ cho thuê phòng rộng khu trung tâm, an  ninh, yên tĩnh, hẻm chính 7m, tiện đi lại, phòng rộng 22m2. Tiện nghi đầy đủ như khách sạn, máy lạnh, nước nóng, tivi LDC, tủ lạnh, giường tủ, bàn ghế...\",\"Giờ giấc tự do, có chỗ để xe.\",\"- Địa chỉ: 181/36 Đường 3/2, P.11, Quận 10.\",\"Giá thuê: 5 triệu/tháng.\",\"Liên hệ: 0919.990.528 Chị Vân - Chính chủ\"]', '64129c2b-6457-458e-9fa1-173232b2878f', 'ed06d6fb-446e-469f-9c41-37c6ce92de95', '8ab04797-a345-4d50-aee9-0b67c9d4c84a', '2025-03-27 13:50:33', '2025-03-27 13:50:33'),
('fa6852a1-7237-495a-9822-181ddeaa050c', 'Cho thuê nhà nguyên căn Đường Võ Thị Thừa', '4', 'YRH2', 'Địa chỉ: 77/18 Võ Thị Thừa, Phường An Phú Đông, Quận 12, Hồ Chí Minh', '64f479a5-3981-443c-90e6-56e9e46c4e00', 'NCT', '[\"Cho thuê nhà nguyên căn 1 triệt 3 lầu diện tích 4x14, có chỗ đậu xe ô tô, có thể làm vp kinh doanh. Nhà hướng Tây ven sông Sài Gòn cực thoáng mát. Liên hệ chủ nhà để được biết thêm chi tiết và xem nhà: 0915476117(Ngân)\"]', 'f6214f15-6ac1-4219-bc41-06c011ec9ca1', '9ab9beae-5e33-4255-824b-eb8be2a208b4', '8cbceba3-d30b-45f0-a778-1569110d7797', '2025-03-27 13:48:20', '2025-03-27 13:48:20'),
('fad3f9e8-6ddf-4b97-abd6-35e3950aa927', 'Cho thuê phòng 20m2 nhà mới xây tại 32/40/38 Đường Bùi Đình Túy, Phường 12, Quận Bình Thạnh', '3', 'MVI6', 'Địa chỉ: 32/40/38 Đường Bùi Đình Túy, Phường 12, Quận Bình Thạnh, Hồ Chí Minh', 'b7b623ef-497c-4d41-bcab-e8efa320e67c', 'CTPT', '[\"- Nhà mới xây xong, nội thất đẹp, hiện đại\",\"- Phòng đầy đủ tiện nghi, mát mẻ\",\"- Có máy lạnh, toilet khép kín trong phòng\",\"- Có giường hộp hiện đại, nệm\",\"- Có bàn làm việc, học tập, tủ lạnh\",\"- Có tủ quần áo rộng rãi\",\"- Giặt và phơi quần áo sân thượng, có máy giặt\",\"- Free wifi, nước nóng lạnh năng lượng mặt trời\",\"- Vị trí yên tĩnh, phù hợp cho sinh viên học hành, người đi làm nghỉ ngơi sau giờ làm\",\"- Gần chợ, siêu thị, phòng gym, nhiều tiện ít xung quanh, giờ giấc tự do\",\"- Phòng ban công\",\"- Điện 3,5k/1kw. Nước 100k/ người\"]', '05054cb9-f68e-45ea-bfd5-86e80ceae18b', 'e3284dac-2b92-495d-b237-e7ff826a6897', '004fe98f-33db-4fb0-9bcd-e271d7302eb0', '2025-03-27 13:50:33', '2025-03-27 13:50:33'),
('fccec087-5966-473e-9b67-848ecf10dd60', 'Cho thuê nhà mặt tiền Kd p. Phú Thọ Hòa,Tân Phú dtsd 60 m2 chỉ 7triệu', '0', 'HXJ7', 'Địa chỉ: Phường Phú Thọ Hòa, Quận Tân Phú, Hồ Chí Minh', 'ccc04f8e-ca1d-4a97-82a6-079f8a8d4d46', 'NCT', '[\"Cho thuê nhà mặt tiền Kd p. Phú Thọ Hòa,Tân Phú dtsd 60 m2 chỉ 7triệu\",\"Nhanh còn kịp!\",\"Cho thuê nhà mặt tiền kinh doanh phường Phú Thọ Hòa, Tân Phú\",\"Dt 4x7m, trệt,lâu. Giá 7 triệu.\",\"Nếu thuê thêm phần lâu 1 bên cạnh nối liền diện tích 5x15m,có ban công 4m,2 phòng ngủ lớn, bếp tolet..view đẹp nhìn xuống mặt tiền đường xung quanh kính vì lúc trước bán cafe thì tất cả chỉ 12 triệu.\",\"- Nội thất gồm có máy lạnh, giường, tủ, tủ lạnh....full nội thất...\",\"Chủ nhà rất dễ thương.. tốt bụng...\",\"Vì trí gần trường học lễ Anh Xuân,Trần Phú,cho f18.UBP Phú Thọ Hòa.\",\"Tiện kinh doanh đa ngành nghề.\",\"Alo 0397077772 em chủ nhà\"]', '37807fea-d4c7-49e8-93b8-7450ebd55f25', '930b2067-daa0-4458-bc1b-79ba255e9d55', 'ad825cf4-66f7-47d4-b3bd-b35e06e96c10', '2025-03-27 13:48:20', '2025-03-27 13:48:20');
